namespace RonSijm.FluidHumidifier.Factories.MediaPackage;

public class PackagingConfigurationFactory(string resourceName = null, Action<Humidifier.MediaPackage.PackagingConfiguration> factoryAction = null) : ResourceFactory<Humidifier.MediaPackage.PackagingConfiguration>(resourceName)
{

    internal InnerPackagingConfigurationMssPackageFactory MssPackageFactory { get; set; }

    internal InnerPackagingConfigurationCmafPackageFactory CmafPackageFactory { get; set; }

    internal InnerPackagingConfigurationHlsPackageFactory HlsPackageFactory { get; set; }

    internal InnerPackagingConfigurationDashPackageFactory DashPackageFactory { get; set; }

    protected override Humidifier.MediaPackage.PackagingConfiguration Create()
    {
        var packagingConfigurationResult = CreatePackagingConfiguration();
        factoryAction?.Invoke(packagingConfigurationResult);

        return packagingConfigurationResult;
    }

    private Humidifier.MediaPackage.PackagingConfiguration CreatePackagingConfiguration()
    {
        var packagingConfigurationResult = new Humidifier.MediaPackage.PackagingConfiguration
        {
            GivenName = InputResourceName,
        };

        return packagingConfigurationResult;
    }
    public override void CreateChildren(Humidifier.MediaPackage.PackagingConfiguration result)
    {
        base.CreateChildren(result);

        result.MssPackage ??= MssPackageFactory?.Build();
        result.CmafPackage ??= CmafPackageFactory?.Build();
        result.HlsPackage ??= HlsPackageFactory?.Build();
        result.DashPackage ??= DashPackageFactory?.Build();
    }

} // End Of Class

